    void Update(){
        if (sock.Available > 0){
            Byte[] data = sock.Receive(ref RemoteIpEndPoint);
            float[] vertexData = new float[468*3];
            Buffer.BlockCopy(data, 0, vertexData, 0, data.Length);
            int curr=0;
            for (int i = 0; i < vertexData.Length; i++){
                if (i%3 == 0){
                    verticies[curr].x = vertexData[i];
                }
                else if (i%3 == 1){
                    verticies[curr].y = vertexData[i];
                }
                else if (i%3 == 2){
                    verticies[curr].z = vertexData[i];
                    curr++;
                }
            }
            mesh.Clear();
            Debug.Log(verticies[0]);
            mesh.SetVertices(verticies);
            if (frames == 0 || (!useFirstFrame)){
                uvs = new Vector2[468];
                for (int i = 0; i < verticies.Length; i++){
                    uvs[i].x = verticies[i].x;
                    uvs[i].y = 1-verticies[i].y;
                }
            }
            if (useLines){
                mesh.SetIndices(connections, MeshTopology.Lines, 0, true, 0);
            }
            else{
                mesh.SetTriangles(triangles, 0);
                mesh.SetUVs(0, uvs);
            }
            Debug.Log("MADE MESH!!!!!!!!");
